#include "common.hpp"
#include<vector>

class Solution {
public:
    int maxProduct(vector<int>& nums) {
        int n = nums.size();
        if(n <= 0) return 0;
        // f_max[i] = max{f_max[i-1] * nums[i], nums[i]}
        // f_min[i] = min{f_min[i-1] * nums[i], nums[i]}
        int res = nums[0];
        int maxv = nums[0];
        int minv = nums[0];
        for(int i = 1; i < n; i++){
            int pre_min = minv;
            int pre_max = maxv;
            minv = min(nums[i], min(pre_min * nums[i], pre_max * nums[i]));
            maxv = max(nums[i], max(pre_min * nums[i], pre_max * nums[i]));
            res = max(res, maxv);
        }
        return res;
    }
    
    
    int maxProduct2(vector<int>& nums) {
        int i, j;
        int n = nums.size();
        if(n <= 0) return 0;
        bool can_be_one = false;
        // remove 1
        for(i = 0, j =0; i < n && j < n;){
            if(nums[j] == 1){
                j++;
                can_be_one = true;
            }
            else{
                nums[i] = nums[j];
                i++;
                j++;
            }
        }
        n = i;
        if(n <= 0) return 1;

        // remove continuous -1
        for(i = 0, j = 0; i < n && j < n;){
            if(nums[j] == -1){
                int len = 0;
                while(j < n && nums[j] == -1){
                    len++;
                    j++;
                }
                if(len % 2 == 1){
                    nums[i] = -1;
                    i++;
                }
                else{
                    nums[i] = -1;
                    i++;
                    nums[i] = -1;
                    i++;
                }
                if(len >= 2) can_be_one = true;
            }
            else{
                nums[i] = nums[j];
                i++;
                j++;
            }
        }
        n = i;

        vector<int> dp(n, 0);
        dp[0] = nums[0];
        int ans = dp[0];
        for(int i = 1; i < n; i++){
            dp[i] = dp[i - 1];
            int tmp = 1;
            for(int j = i; j >= 0; j--){
                tmp *= nums[j];
                dp[i] = tmp > dp[i] ? tmp: dp[i];
            }
            ans = dp[i] > ans ? dp[i] : ans;
        }
        if(can_be_one) ans = ans > 1 ? ans : 1;
        return ans;
    }
};

